import Card from "./components/card";
import { trekData } from "./trekInfo";

function App() {
  return (
    <div>
      <ul className="grid grid-flow-col overflow-y-auto">
          {
            trekData.map((item) => <li><Card key={item.id} data={item} /></li> )
          }
      </ul>
    </div>
  );
}

export default App;
